CREATE SEQUENCE seq_upload
   INCREMENT BY 10 START WITH 1000
   MAXVALUE 3000000 MINVALUE 1000
   NOCYCLE CACHE 10 ORDER;
   
select seq_upload.nextval, re.project_id, pp.project_phase_id, re.resource_id, 1, 1, '', 'https://www.7-zip.org/a/7za920.zip', '132456', SYSDATE, '132456', SYSDATE
from project_phase pp, resource re 
where pp.project_id >= 30005000 and pp.phase_type_id = 2 and re.project_id = pp.project_id and re.resource_role_id = 1;

CREATE SEQUENCE seq_submission
   INCREMENT BY 10 START WITH 1000
   MAXVALUE 3000000 MINVALUE 1000
   NOCYCLE CACHE 10 ORDER;

select seq_submission.nextval, upload_id, 1, 1, user_id, sysdate, user_id, sysdate from upload, resource 
where resource.project_id >= 30005000 and resource_role_id = 1 and upload.resource_id = resource.resource_id;

